func TestDecodeMainPID(t *testing.T) {
	conn := bytes.NewReader(mainPIDResponse)
	msgDec := newMessageDecoder()

	pid, err := msgDec.DecodeMainPID(conn)
	if err != nil {
		t.Fatal(err)
	}

	var want uint32 = 2375
	if want != pid {
		t.Errorf("expected pid %d got %d", want, pid)
	}
}

