func TestDecodeListUnits(t *testing.T) {
	conn := bytes.NewReader(listUnitResponse)
	msgDec := newMessageDecoder()
	got := make([]Unit, 0, len(expectedServices))

	stat := &runtime.MemStats{}
	runtime.GC()
	runtime.ReadMemStats(stat)
	liveBefore := int(stat.Mallocs - stat.Frees)

	err := msgDec.DecodeListUnits(conn, func(u *Unit) {
		if strings.HasSuffix(u.Name, ".service") {
			got = append(got, *u)
		}
	})
	if err != nil {
		t.Fatal(err)
	}

	// Check for memory leaks, i.e.,
	// there shouldn't be more objects in the heap than
	// it was before calling decodeListUnits.
	runtime.GC()
	runtime.ReadMemStats(stat)
	liveAfter := int(stat.Mallocs - stat.Frees)
	if liveAfter > liveBefore {
		t.Errorf("too many live objects after GC: before %d, after %d", liveBefore, liveAfter)
	}

	if diff := cmp.Diff(expectedServices, got); diff != "" {
		t.Error(diff)
	}
}

func BenchmarkDecodeListUnits(b *testing.B) {
	conn := bytes.NewReader(listUnitResponse)
	msgDec := newMessageDecoder()
	got := make([]Unit, 0, len(expectedServices))

	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		conn.Seek(0, io.SeekStart)
		got = got[:0]

		err := msgDec.DecodeListUnits(conn, func(u *Unit) {
			if strings.HasSuffix(u.Name, ".service") {
				got = append(got, *u)
			}
		})
		if err != nil {
			b.Error(err)
		}
	}
}

